CKEDITOR.plugins.setLang("a11yhelp","pl",{title:"Instrukcje dost\u0119pno\u015bci",contents:"Zawarto\u015b\u0107 pomocy. Wci\u015bnij ESC, aby zamkn\u0105\u0107 to okno.",legend:[{name:"Og\xf3lne",items:[{name:"Pasek narz\u0119dzi edytora",legend:"Wci\u015bnij ${toolbarFocus} aby przej\u015b\u0107 do paska narz\u0119dzi. Przejd\u017a do nast\u0119pnej i poprzedniej grupy narz\u0119dzi u\u017cywaj\u0105c TAB oraz SHIFT-TAB. Przejd\u017a do nast\u0119pnego i poprzedniego narz\u0119dzia u\u017cywaj\u0105c STRZA\u0141KI W PRAWO lub STRZA\u0141KI W LEWO. Wci\u015bnij SPACJ\u0118 lub ENTER, aby aktywowa\u0107 zaznaczone narz\u0119dzie."},{name:"Okno dialogowe",legend:"B\u0119d\u0105c w oknie dialogowym wci\u015bnij TAB aby przej\u015b\u0107 do nast\u0119pnego pola dialogowego, wci\u015bnij SHIFT + TAB aby przej\u015b\u0107 do poprzedniego pola, wci\u015bnij ENTER aby wys\u0142a\u0107 dialog, wci\u015bnij ESC aby anulowa\u0107 dialog. Dla okien dialogowych z wieloma zak\u0142adkami, wci\u015bnij ALT + F10 aby przej\u015b\u0107 do listy zak\u0142adek. Gdy to zrobisz przejd\u017a do nast\u0119pnej zak\u0142adki wciskaj\u0105c TAB lub STRZA\u0141K\u0118 W PRAWO. Przejd\u017a do poprzedniej zak\u0142adki wciskaj\u0105c SHIFT + TAB lub STRZA\u0141K\u0118 W LEWO. Wci\u015bnij SPACJ\u0118 lub ENTER aby wybra\u0107 zak\u0142adk\u0119."},{name:"Menu kontekstowe edytora",legend:"Wci\u015bnij ${contextMenu} lub PRZYCISK APLIKACJI aby otworzy\u0107 menu kontekstowe. Przejd\u017a do nast\u0119pnej pozycji menu wciskaj\u0105c TAB lub STRZA\u0141K\u0118 W D\xd3\u0141. Przejd\u017a do poprzedniej pozycji menu wciskaj\u0105c SHIFT + TAB lub STRZA\u0141K\u0118 W G\xd3R\u0118. Wci\u015bnij SPACJ\u0118 lub ENTER aby wygra\u0107 pozycj\u0119 menu. Otw\xf3rz pod-menu obecnej pozycji wciskaj\u0105c SPACJ\u0118 lub ENTER lub STRZA\u0141K\u0118 W PRAWO. Wr\xf3\u0107 do pozycji nadrz\u0119dnego menu wciskaj\u0105c ESC lub STRZA\u0141K\u0118 W LEWO. Zamknij menu wciskaj\u0105c ESC."},{name:"Editor List Box",legend:"Inside a list-box, move to next list item with TAB OR DOWN ARROW. Move to previous list item with SHIFT + TAB or UP ARROW. Press SPACE or ENTER to select the list option. Press ESC to close the list-box."},{name:"Editor Element Path Bar",legend:"Press ${elementsPathFocus} to navigate to the elements path bar. Move to next element button with TAB or RIGHT ARROW. Move to previous button with  SHIFT+TAB or LEFT ARROW. Press SPACE or ENTER to select the element in editor."}]},{name:"Polecenia",items:[{name:"Cofnij polecenie",legend:"Wci\u015bnij ${undo}"},{name:"Pon\xf3w polecenie",legend:"Wci\u015bnij ${redo}"},{name:"Polecenie pogrubienia",legend:"Wci\u015bnij ${bold}"},{name:"Polecenie kursywy",legend:"Wci\u015bnij ${italic}"},{name:"Polecenie podkre\u015blenia",legend:"Wci\u015bnij ${underline}"},{name:"Polecenie hiper\u0142\u0105cza",legend:"Wci\u015bnij ${link}"},{name:"Polecenie schowaj pasek narz\u0119dzi",legend:"Wci\u015bnij ${toolbarCollapse}"},{name:" Access previous focus space command",legend:"Press ${accessPreviousSpace} to access the closest unreachable focus space before the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:" Access next focus space command",legend:"Press ${accessNextSpace} to access the closest unreachable focus space after the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:"Pomoc dost\u0119pno\u015bci",legend:"Wci\u015bnij ${a11yHelp}"}]}]});